// Fungsi utama untuk mendapatkan data form (DIPERBAIKI)
async function getFormData() {
  let retryCount = 0;
  const maxRetries = 5; // Meningkatkan jumlah retry
  
  while (retryCount < maxRetries) {
    try {
      // Buat instance axios baru untuk setiap percobaan
      const axiosInstance = axios.create({
        timeout: config.timeout,
        headers: {
          ...config.headers,
          'User-Agent': getRandomUserAgent(),
          'Accept': 'text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,*/*;q=0.8',
          'Accept-Encoding': 'gzip, deflate, br',
          'Connection': 'keep-alive'
        },
        // Tambahkan opsi untuk mengikuti redirect
        maxRedirects: 5,
        validateStatus: (status) => status >= 200 && status < 400
      });

      console.log(`${colors.CYAN}[*] Memulai permintaan ke WhatsApp...${colors.RESET}`);
      
      // Langkah 1: Dapatkan cookies dan token CSRF
      const initialResponse = await axiosInstance.get(config.baseUrl);
      
      // Simpan cookies
      const cookies = initialResponse.headers['set-cookie'] || [];
      const cookieHeader = cookies.join('; ');
      
      // Langkah 2: Akses halaman form dengan cookies
      console.log(`${colors.CYAN}[*] Mengakses halaman form kontak...${colors.RESET}`);
      const formResponse = await axiosInstance.get(config.contactUrl, {
        headers: {
          'Cookie': cookieHeader
        }
      });
      
      // Parse HTML form
      const $ = cheerio.load(formResponse.data);
      
      // Cari form yang benar (diperbarui selector-nya)
      const form = $('form[action*="/contact/"]').first();
      
      if (!form.length) {
        throw new Error('Form tidak ditemukan di halaman - mungkin struktur HTML berubah');
      }
      
      // Ekstrak semua field form (termasuk textarea dan select)
      const formData = {};
      form.find('input, textarea, select').each((i, elem) => {
        const $elem = $(elem);
        const name = $elem.attr('name');
        const value = $elem.attr('value') || '';
        if (name) {
          formData[name] = value;
          console.log(`${colors.BLUE}[+] Field ditemukan: ${name} = ${value}${colors.RESET}`);
        }
      });
      
      // Verifikasi field yang diperlukan (diperbarui)
      const requiredFields = ['fb_dtsg', 'jazoest', 'lsd', 'authenticity_token', 'csrftoken'];
      const missingFields = requiredFields.filter(field => !formData[field]);
      
      if (missingFields.length > 0) {
        // Coba cari field yang diperlukan dengan cara berbeda
        const metaFields = $('meta[name^="csrf"]');
        metaFields.each((i, elem) => {
          const $elem = $(elem);
          const name = $elem.attr('name');
          const content = $elem.attr('content');
          if (name && content) {
            formData[name] = content;
            console.log(`${colors.GREEN}[+] CSRF meta tag ditemukan: ${name} = ${content}${colors.RESET}`);
          }
        });
        
        // Periksa lagi setelah menambahkan meta tags
        const stillMissing = requiredFields.filter(field => !formData[field]);
        if (stillMissing.length > 0) {
          throw new Error(`Field penting masih tidak ditemukan: ${stillMissing.join(', ')}`);
        }
      }
      
      console.log(`${colors.GREEN}[✓] Berhasil mendapatkan data form${colors.RESET}`);
      return formData;
      
    } catch (error) {
      retryCount++;
      console.error(`${colors.RED}[!] Percobaan ${retryCount}/${maxRetries} gagal: ${error.message}${colors.RESET}`);
      
      if (error.response) {
        console.error(`${colors.RED}Status: ${error.response.status}${colors.RESET}`);
        console.error(`${colors.RED}Data: ${JSON.stringify(error.response.data).substring(0, 200)}...${colors.RESET}`);
      }
      
      if (retryCount < maxRetries) {
        const delay = Math.pow(2, retryCount) * 1000; // Exponential backoff
        console.log(`${colors.YELLOW}[⌛] Menunggu ${delay/1000} detik sebelum mencoba lagi...${colors.RESET}`);
        await sleep(delay);
      } else {
        console.error(`${colors.RED}[✗] Gagal mendapatkan data form setelah ${maxRetries} percobaan${colors.RESET}`);
        return null;
      }
    }
  }
}

// Fungsi untuk submit laporan (DIPERBAIKI)
async function submitReport(phone, formData) {
  const cleanedPhone = cleanPhoneNumber(phone);
  
  // Data yang akan dikirim (diperbarui)
  const postData = {
    ...formData,
    'phone': cleanedPhone,
    'email': generateRandomEmail(),
    'issue': 'spam',
    'subject': 'messenger',
    'description': generateReportText(cleanedPhone),
    'country': 'ID',
    'platform': 'Android',
    'language': 'en',
    'submit': 'Submit Report',
    'source_url': config.contactUrl,
    'timestamp': Date.now()
  };

  try {
    const axiosInstance = axios.create({
      timeout: config.timeout,
      headers: {
        ...config.headers,
        'User-Agent': getRandomUserAgent(),
        'Content-Type': 'application/x-www-form-urlencoded',
        'Content-Length': Buffer.byteLength(qs.stringify(postData)),
        'Accept': '*/*',
        'Cache-Control': 'no-cache'
      },
      maxRedirects: 0,
      validateStatus: () => true
    });

    console.log(`${colors.CYAN}[*] Mengirim laporan untuk nomor ${cleanedPhone}...${colors.RESET}`);
    const response = await axiosInstance.post(config.contactUrl, qs.stringify(postData));

    // Analisis response (diperbarui)
    if (response.status === 302 || response.status === 301) {
      console.log(`${colors.GREEN}[✓] Laporan berhasil dikirim (Redirect ke ${response.headers.location})${colors.RESET}`);
      return {
        status: response.status,
        success: true,
        redirect: response.headers.location
      };
    }

    if (/captcha|CAPTCHA|security check/i.test(response.data)) {
      console.error(`${colors.YELLOW}[!] CAPTCHA terdeteksi${colors.RESET}`);
      return {
        status: 403,
        success: false,
        error: 'CAPTCHA terdeteksi'
      };
    }

    if (response.status === 200 && response.data.includes('Thank you')) {
      console.log(`${colors.GREEN}[✓] Laporan berhasil dikirim${colors.RESET}`);
      return {
        status: response.status,
        success: true,
        data: response.data
      };
    }

    // Jika tidak ada kondisi di atas terpenuhi
    console.log(`${colors.YELLOW}[?] Response tidak dikenali: Status ${response.status}${colors.RESET}`);
    return {
      status: response.status,
      success: false,
      error: 'Response tidak dikenali',
      data: response.data
    };

  } catch (error) {
    console.error(`${colors.RED}[!] Error saat mengirim laporan: ${error.message}${colors.RESET}`);
    
    if (error.response) {
      console.error(`${colors.RED}Status error: ${error.response.status}${colors.RESET}`);
      console.error(`${colors.RED}Data error: ${JSON.stringify(error.response.data).substring(0, 200)}...${colors.RESET}`);
    }
    
    return {
      status: error.response?.status || 500,
      success: false,
      error: error.message
    };
  }
}

// Fungsi utama untuk menjalankan laporan
async function runReport(phone, count, chatId = null) {
  const cleanedPhone = cleanPhoneNumber(phone);
  let successCount = 0;
  let captchaCount = 0;
  let failedCount = 0;

  // Pesan awal
  const startMessage = `🚀 Memulai proses laporan untuk: ${cleanedPhone}\n📊 Jumlah laporan: ${count}`;
  if (chatId) await bot.sendMessage(chatId, startMessage);
  else console.log(`\n${colors.CYAN}${startMessage}${colors.RESET}`);

  for (let i = 0; i < count; i++) {
    const attempt = i + 1;
    let message = '';
    
    // Status percobaan
    const attemptMessage = `🔄 Percobaan ${attempt}/${count}`;
    if (chatId) await bot.sendMessage(chatId, attemptMessage);
    else console.log(`\n${colors.MAGENTA}${attemptMessage}${colors.RESET}`);

    // Dapatkan data form
    const formData = await getFormData();
    if (!formData) {
      message = '❌ Gagal mendapatkan data form';
      failedCount++;
      if (chatId) await bot.sendMessage(chatId, message);
      else console.log(message);
      await sleep(30000);
      continue;
    }

    // Kirim laporan
    const response = await submitReport(cleanedPhone, formData);
    
    if (response.success) {
      successCount++;
      message = `✅ Berhasil (Status: ${response.status})`;
    } else if (response.error === 'CAPTCHA terdeteksi') {
      captchaCount++;
      message = '⚠️ CAPTCHA terdeteksi - Coba lagi nanti';
    } else if (response.status === 429) {
      message = '⚠️ Terlalu banyak permintaan (Status: 429)';
      failedCount++;
    } else {
      message = `❌ Gagal (Status: ${response.status}) - ${response.error || 'Tidak diketahui'}`;
      failedCount++;
    }

    // Tampilkan hasil
    if (chatId) await bot.sendMessage(chatId, message);
    else console.log(message.includes('✅') ? `${colors.GREEN}${message}${colors.RESET}` : 
           message.includes('⚠️') ? `${colors.YELLOW}${message}${colors.RESET}` : 
           `${colors.RED}${message}${colors.RESET}`);

    // Delay antara percobaan
    const delay = 120000 + (Math.random() * 60000); // 2-3 menit
    const delayMessage = `⏳ Menunggu ${Math.round(delay/1000)} detik sebelum percobaan berikutnya...`;
    
    if (chatId && i < count - 1) await bot.sendMessage(chatId, delayMessage);
    else if (!chatId) console.log(`${colors.YELLOW}${delayMessage}${colors.RESET}`);
    
    await sleep(delay);
  }

  // Ringkasan akhir
  const summary = `📊 Ringkasan laporan:
✅ Berhasil: ${successCount}
⚠️ CAPTCHA: ${captchaCount}
❌ Gagal: ${failedCount}`;

  if (chatId) await bot.sendMessage(chatId, summary);
  else {
    console.log(`\n${colors.CYAN}══════════════════════════════════════════${colors.RESET}`);
    console.log(`${colors.GREEN}${summary}${colors.RESET}`);
  }
}

// Command Telegram Bot
bot.onText(/\/start/, (msg) => {
  const chatId = msg.chat.id;
  bot.sendMessage(chatId, `🤖 WhatsApp Report Bot\n\nGunakan perintah:\n/phone [nomor] [jumlah] - Laporkan nomor telepon\nContoh: /phone +6281234567890 3`);
});

bot.onText(/\/phone (.+)/, async (msg, match) => {
  const chatId = msg.chat.id;
  const input = match[1].trim().split(' ');
  
  if (input.length < 2) {
    return bot.sendMessage(chatId, '❌ Harap berikan nomor telepon dan jumlah laporan\nContoh: /phone +6281234567890 3');
  }
  
  const phone = input[0];
  const count = parseInt(input[1]) || 1;
  const safeCount = Math.min(Math.max(count, 1), 5); // Batasi 1-5 laporan
  
  if (!phone.match(/^\+?[0-9]{10,15}$/)) {
    return bot.sendMessage(chatId, '❌ Format nomor telepon tidak valid. Harap sertakan kode negara\nContoh: +6281234567890');
  }
  
  await runReport(phone, safeCount, chatId);
});

// Antarmuka console
function startConsoleInterface() {
  const rl = readline.createInterface({
    input: process.stdin,
    output: process.stdout
  });

  console.log(`${colors.CYAN}
=============================================
 WhatsApp Report Bot - By LordHozoo
=============================================
${colors.RESET}`);

  rl.question('[?] Masukkan nomor telepon (contoh: +628...): ', (phone) => {
    rl.question('[?] Jumlah laporan (rekomendasi 1-5): ', async (count) => {
      const num = Math.min(Math.max(parseInt(count) || 1, 1), 5);
      await runReport(phone, num);
      rl.close();
    });
  });
}

// Jalankan bot
console.log(`${colors.GREEN}Bot Telegram telah aktif!${colors.RESET}`);
startConsoleInterface();
